**Os Códigos Secretos dos Illuminatis** 📙

_Obs: Devemos utilizá-los a nosso favor, pois o conhecimento aqui descrito foi apenas "profanado"._

🔥 **As Etapas seguintes resumem as Leis do nosso Universo Humano:**

1 - **Aquisição de Conhecimento** (intuições e percepções sobre a vida) encaminha a Consciência;

2 - **Consciência** (luz) encaminha ao Potencial;

3 - **Potencial** (a energia) conduz a Oportunidade;

4 - **Oportunidade** (a união com o mundo físico) irá potencializar a Criatividade;

5 - **Criatividade** (a arte de alterar a realidade com os pensamentos = Maçonaria) conduz a Inspiração;

6 - **Inspiração** (idéias) conduz a Verdade;

7 - **Verdade** (a capacidade para "Ver sem Pensar") conduz ao Poder;

8 - **Poder** (Realização) conduz a Transformação;

9 - **Transformação** (transmutação) encaminha a Sabedoria;

10 - **Sabedoria** é a imortalidade da alma;

Quando se atinge o último nível, existe a sensação de **Imortalidade**, pois o indivíduo fica habilitado com os mistérios da vida.

Fiquem tranquilos, já consertaram a Ponte Rio-Niterói.
