Você pode se surpreender, mas a funcionalidade de uma pá tão pequena é muito ampla: 

• escavação;
• remoção de mato; 
• escavação de valas; 
• subir encostas íngremes; 
• martelar pregos; 
• corte de galhos; 
• afiação de estacas; 
• substituição de um facão; 
• Defesa pessoal; 
• corte; 
• cozinhar alimentos; 
• medição de distâncias; 
• suporte para o queimador; 
• remo para barcos. 

Tenha certeza de que esta não é uma lista completa da necessidade que ditará a própria decisão. 
É bom se a pá estiver com você. Se falamos do MPL-50, seu peso é de cerca de 750 G. Ele não ocupa muito espaço em uma mochila arrumada ao colocada na parte traseira, com o eixo para cima.
Caso necessite de uma pá mais versátil e leve, existe hoje pá militar multifunções que dobrará a sua capacidade de utilização.

